import React from 'react';
import './EnterpreneurForm.css';

const enterpreneur = () => {
  return (
    <form className="Enterpreneur-form">
      <h4 className="Enterpreneur-form__title">Список реквизитов для индивидуальных предпринимателей</h4>

      <div className="Enterpreneur-form__group">
        <input type="text" inputMode="text" name="name" id="name" required placeholder="ИП Иванов Иван Иванович"></input>
        <label for="name">ИП ФИО</label>
      </div>

      <div className="Enterpreneur-form__group">
        <input type="text" inputMode="text" name="inn" id="inn" required placeholder="7778644521"></input>
        <label for="inn">ИНН</label>
      </div>

      <div className="Enterpreneur-form__group">
        <input type="text" inputMode="text" name="ogrnip" id="ogrnip" required placeholder="1076564644123"></input>
        <label for="ogrnip">ОГРНИП</label>
      </div>

      <div className="Enterpreneur-form__group">
        <label for="adress">Юридический адрес</label>
        <input type="text" inputMode="text" name="adress" id="adress" placeholder="129123, г. Москва, ул. Маломосковская, д. 12, стр.4." required></input>
      </div>

      <div className="Enterpreneur-form__group">
        <label for="phone">Номер телефона</label>
        <input type="text" inputMode="text" name="phone" id="phone" placeholder="79031577557" required></input>
      </div>

    </form>
  );
};

export default enterpreneur;
